import React from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink
} from "reactstrap";
import { slide as Menu } from "react-burger-menu";
import "./App.css";

export default class Robots extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      collapsed: true,
      menuOpen: true
    };
  }

  handleStateChange = state => {
    this.setState({ menuOpen: true });
  };

  showSettings = event => {
    event.preventDefault();
  };

  closeMenu() {
    this.setState({ menuOpen: false });
  }

  render() {
    let styles = {
      bmBurgerButton: {
        position: "relative",
        width: "36px",
        height: "30px",
        left: "23em",
        top: "36px"
      },
      bmBurgerBars: {
        background: "#373a47"
      },
      bmBurgerBarsHover: {
        background: "#a90000"
      },
      bmCrossButton: {
        height: "24px",
        width: "24px"
      },
      bmCross: {
        background: "#bdc3c7"
      },
      bmMenuWrap: {
        position: "fixed",
        height: "100%"
      },
      bmMenu: {
        background: "#373a47",
        padding: "2.5em 1.5em 0",
        fontSize: "1.15em"
      },
      bmMorphShape: {
        fill: "#373a47"
      },
      bmItemList: {
        color: "#b8b7ad",
        padding: "0.8em"
      },
      bmItem: {
        display: "inline-block !important"
      },
      bmOverlay: {
        background: "rgba(0, 0, 0, 0.3)"
      }
    };
    return (
      <>
        <div>
          <Navbar color="faded" light>
            <Menu
              right
              styles={styles}
              width={"15em"}
              isOpen={this.state.menuOpen}
              onStateChange={state => this.handleStateChange(state)}
            >
              <a
                id="home"
                className="menu-item"
                href="/"
                onClick={() => this.closeMenu()}
              >
                Home
              </a>
              <a
                id="about"
                className="menu-item"
                href="/about"
                onClick={() => this.closeMenu()}
              >
                About
              </a>
              <a
                id="contact"
                className="menu-item"
                href="/contact"
                onClick={() => this.closeMenu()}
              >
                Contact
              </a>
              <a
                onClick={this.showSettings}
                className="menu-item--small"
                href=""
                onClick={() => this.closeMenu()}
              >
                Settings
              </a>
            </Menu>
            <NavbarBrand href="/" className="mr-auto">
              reactstrap
            </NavbarBrand>
          </Navbar>
        </div>
        <div className="wrapper">
          <div className="a">a</div>
          <div className="b">b</div>
          <div className="c">C</div>
          <div className="d">D</div>
          <div className="e">E</div>
          <div className="f">F</div>
          <div className="g">G></div>
        </div>
      </>
    );
  }
}
